function showPastWeekChart(a){var t={responsive:!1},e=[],o=[];a.forEach(function(a){e.push(a[0]),o.push(a[1])});{var l={labels:e.reverse(),datasets:[{label:"occurrences of this word from the past week",fillColor:"rgba(220,220,220,0.2)",strokeColor:"rgba(220,220,220,1)",pointColor:"rgba(220,220,220,1)",pointStrokeColor:"#fff",pointHighlightFill:"#fff",pointHighlightStroke:"rgba(220,220,220,1)",data:o.reverse()}]},r=document.getElementById("line-chart").getContext("2d");new Chart(r).Line(l,t)}}function showPolarityChart(a){labels=[],dataPositive=[],dataNegative=[],dataUnknown=[],a.forEach(function(a){labels.push(a.date),dataPositive.push(a.positive),dataNegative.push(a.negative),dataUnknown.push(a.unknown)});{var t={labels:labels,datasets:[{label:"positive feelings",fillColor:"rgba(137,177,116,0.5)",strokeColor:"rgba(137,177,116,0.8)",highlightFill:"rgba(137,177,116,0.75)",highlightStroke:"rgba(137,177,116,1)",data:dataPositive},{label:"negative feelings",fillColor:"rgba(174,62,61,0.5)",strokeColor:"rgba(174,62,61,0.8)",highlightFill:"rgba(174,62,61,0.75)",highlightStroke:"rgba(174,62,61,1)",data:dataNegative},{label:"unknown feelings",fillColor:"rgba(175,175,175,0.5)",strokeColor:"rgba(175,175,175,0.8)",highlightFill:"rgba(175,175,175,0.75)",highlightStroke:"rgba(175,175,175,1)",data:dataUnknown}]},e=document.getElementById("polarity-chart").getContext("2d");new Chart(e).Bar(t)}}